import { render } from "react-dom";
import { LogoNodejs } from "react-ionicons";

const Footer = () => {
  return (
    <>
      <div>
        <h3>@John Y.</h3>
        <ul>
          <li>
            <LogoNodejs
              color={"#00000"}
              rotate
              height="250px"
              width="250px"
              onClick={() => alert("Hi!")}
            />
          </li>
        </ul>
      </div>
    </>
  );
};

export default Footer;
